import React from 'react'
import Container from 'react-bootstrap/Container';
import Navbar from 'react-bootstrap/Navbar';
import Button from 'react-bootstrap/Button';
import { Outlet } from 'react-router-dom';
//import { Outlet, Link } from 'react-router-dom'

const Layout = () => {
  return (
    <div>
    <Navbar variant="dark">
    <Container>
      <Navbar.Brand href="#home" className="navBrand">Sound<span style={{color: '#f8b296'}}>we</span></Navbar.Brand>  
        <Navbar.Text>
        <Button href="#login" variant="outline-secondary" className='navBtn'>Zaloguj się / Załóż konto</Button>
        </Navbar.Text>     
    </Container>    
  </Navbar>
  <div>    
        <Outlet />    
  </div>
  </div>
  )
}

export default Layout
